import { version } from 'vue';
export default {
  name: 'AdminTest',
  data() {
    return {
      vueVersion: version,
      adminServiceStatus: {
        text: 'Unknown',
        class: 'bg-secondary'
      },
      clientServiceStatus: {
        text: 'Unknown',
        class: 'bg-secondary'
      }
    };
  },
  async mounted() {
    console.log('AdminTest component mounted successfully');
    this.checkServices();
  },
  methods: {
    async checkServices() {
      // Check admin auth service
      try {
        const adminAuthService = await import('@/services/adminAuthService');
        if (adminAuthService.default) {
          this.adminServiceStatus = {
            text: 'Available',
            class: 'bg-success'
          };
        } else {
          this.adminServiceStatus = {
            text: 'Not Available',
            class: 'bg-danger'
          };
        }
      } catch (error) {
        console.error('Admin service check failed:', error);
        this.adminServiceStatus = {
          text: 'Error',
          class: 'bg-danger'
        };
      }

      // Check client auth service
      try {
        const clientAuthService = await import('@/services/clientAuthService');
        if (clientAuthService.default) {
          this.clientServiceStatus = {
            text: 'Available',
            class: 'bg-success'
          };
        } else {
          this.clientServiceStatus = {
            text: 'Not Available',
            class: 'bg-danger'
          };
        }
      } catch (error) {
        console.error('Client service check failed:', error);
        this.clientServiceStatus = {
          text: 'Error',
          class: 'bg-danger'
        };
      }
    }
  }
};
